import React from 'react';
import './homepage.css'


export default class ChatSection extends React.Component {
  render() {
    return (
        <div>
            <div className="how-it-works-1" style={{height:'700px'}}>
                <div className="container">
                    <h1 className="header-large-title">The Shoppermint Network</h1>
                    <p className="header-small-title">Where upcycling designers shop for fabric</p>
                </div>
            </div>
            <div className="how-it-works-2" style={{height:'700px'}}>
                <div className="container">
                    <h1 className="header-large-title">The Shoppermint Network</h1>
                    <p className="header-small-title">Where upcycling designers shop for fabric</p>
                </div>
            </div>
        </div>
    );
  }
}
